    pageIndx: 51,
    juzuuIndx: 3,
    lineTxt:
      " مُّطَهَّرَةٞ وَرِضۡوَٰنٞ مِّنَ ٱللَّهِۗ وَٱللَّهُ بَصِيرُۢ بِٱلۡعِبَادِ ١٥ ",
    localLineIndx: 28,
    quart: 5.25,
    surahIndx: 3,
    txtNoTashkeel: " مطهرة ورضوٰن من الله والله بصير بالعباد  ",
