    pageIndx: 91,
    juzuuIndx: 5,
    lineTxt:
      " وَأَشَدُّ تَنكِيلٗا ٨٤ مَّن يَشۡفَعۡ شَفَٰعَةً حَسَنَةٗ يَكُن لَّهُۥ ",
    localLineIndx: 220,
    quart: 8.75,
    surahIndx: 4,
    txtNoTashkeel: " واشد تنكيلا  من يشفع شفٰعة حسنة يكن له ",
