    pageIndx: 93,
    juzuuIndx: 5,
    lineTxt: " عَلِيمًا حَكِيمٗا ٩٢ وَمَن يَقۡتُلۡ مُؤۡمِنٗا مُّتَعَمِّدٗا ",
