    pageIndx: 110,
    juzuuIndx: 6,
    lineTxt: " ٱلۡمَسِيحَ ٱبۡنَ مَرۡيَمَ وَأُمَّهُۥ وَمَن فِي ٱلۡأَرۡضِ ",
    localLineIndx: 66,
    quart: 10.5,
    surahIndx: 5,
    txtNoTashkeel: " المسيح ابن مريم وامه ومن في الارض ",
