    pageIndx: 209,
    juzuuIndx: 11,
    lineTxt:
      " لِلۡمُسۡرِفِينَ مَا كَانُواْ يَعۡمَلُونَ ١٢ وَلَقَدۡ أَهۡلَكۡنَا ٱلۡقُرُونَ ",
    localLineIndx: 25,
    quart: 19.75,
    surahIndx: 10,
    txtNoTashkeel: " للمسرفين ما كانوا يعملون  ولقد اهلكنا القرون ",
