    pageIndx: 210,
    juzuuIndx: 11,
    lineTxt:
      " سَبَقَتۡ مِن رَّبِّكَ لَقُضِيَ بَيۡنَهُمۡ فِيمَا فِيهِ يَخۡتَلِفُونَ ١٩ ",
    localLineIndx: 41,
    quart: 19.75,
    surahIndx: 10,
    txtNoTashkeel: " سبقت من ربك لقضي بينهم فيما فيه يختلفون  ",
