    pageIndx: 210,
    juzuuIndx: 11,
    lineTxt:
      " وَيَقُولُونَ لَوۡلَآ أُنزِلَ عَلَيۡهِ ءَايَةٞ مِّن رَّبِّهِۦۖ فَقُلۡ إِنَّمَا ",
    localLineIndx: 42,
    quart: 19.75,
    surahIndx: 10,
    txtNoTashkeel: " ويقولون لولا انزل عليه ءاية من ربه فقل انما ",
