    pageIndx: 212,
    juzuuIndx: 11,
    lineTxt:
      " ٱلۡحَقِّۖ وَضَلَّ عَنۡهُم مَّا كَانُواْ يَفۡتَرُونَ ٣٠ قُلۡ مَن يَرۡزُقُكُم مِّنَ ",
    localLineIndx: 68,
