    pageIndx: 582,
    juzuuIndx: 30,
    lineTxt:
      " كَلَّا سَيَعۡلَمُونَ ٤ ثُمَّ كَلَّا سَيَعۡلَمُونَ ٥ أَلَمۡ نَجۡعَلِ ٱلۡأَرۡضَ مِهَٰدٗا ٦ ",
