    pageIndx: 582,
    juzuuIndx: 30,
    lineTxt:
      " وَجَعَلۡنَا ٱلَّيۡلَ لِبَاسٗا ١٠ وَجَعَلۡنَا ٱلنَّهَارَ مَعَاشٗا ١١ وَبَنَيۡنَا ",
    localLineIndx: 4,
    quart: 49.75,
