    pageIndx: 591,
    juzuuIndx: 30,
    lineTxt:
      " خُلِقَ مِن مَّآءٖ دَافِقٖ ٦ يَخۡرُجُ مِنۢ بَيۡنِ ٱلصُّلۡبِ وَٱلتَّرَآئِبِ ٧ إِنَّهُۥ ",
    localLineIndx: 3,
    quart: 49.75,
    surahIndx: 86,
